import {Link} from "react-router-dom";
import { NavBar, Heading, NotifDiv } from "./task-nav.styles"

export const TaskNav = ({title}) => {
    return (
        <NavBar>
            <Link to = "/all-projects" style={{textDecoration:'none'}}> {`< Back`} </Link>
            <Heading> {title} </Heading>
            <NotifDiv> N </NotifDiv>
        </NavBar>
    )
}
